import React, {useState, useEffect} from 'react';
import '../Styles/Nav.css';
import { Link } from 'react-router-dom';
function Nav (){
    return(
        <nav>
            <Link className="navLink" to='/'>
             <li>Home</li>
            </Link>

            <Link className="navLink" to='/profile'>
             <li>Profile</li>
            </Link>

            <Link className="navLink" to='chart'>
             <li>Ratings</li>
            </Link>


        </nav>
    )
}

export default Nav;
